const setisfy = (obj) => {
    if (obj instanceof Set)
        return Array.from(obj);
    if (typeof obj === 'object')
        for (const key in obj)
            obj[key] = setisfy(obj[key]);
    return obj;
};
const unsetisfy = (obj) => {
    if (Array.isArray(obj))
        return new Set(obj);
    if (typeof obj === 'object')
        for (const key in obj)
            obj[key] = unsetisfy(obj[key]);
    return obj;
};
export const serialize = (data) => setisfy(structuredClone(data));
export const deserialize = (data) => unsetisfy(data);
